import React from "react";

const AllAnimals = ({ animals, pickAnimal }) => (
  <div className="text-center">
    <div>
      <h3>Puppies!</h3>
      <ul className="list-unstyled">
        {animals.map(animal => (
          <li key={animal.id}>
            <div role="button" className="puppylink" onClick={pickAnimal(animal.id)}>
              {animal.name}
            </div>
          </li>
        ))}
      </ul>
    </div>
  </div>
);

export default AllAnimals;
